import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { ThemeProvider, createTheme } from '@mui/material/styles';
import CssBaseline from '@mui/material/CssBaseline';
import { AuthProvider } from './context/AuthContext';
import { SocketProvider } from './context/SocketContext';
import LoginPage from './pages/LoginPage';
import RegisterPage from './pages/RegisterPage';
import PatientDashboard from './pages/PatientDashboard';
import DoctorDashboard from './pages/DoctorDashboard';
import ChatPage from './pages/ChatPage';
import PrivateRoute from './components/common/PrivateRoute';

const theme = createTheme({
  shape: {
    borderRadius: 10,
  },
  shadows: [
    'none',
    '0px 1px 2px rgba(15, 23, 42, 0.05)',
    '0px 1px 3px rgba(15, 23, 42, 0.1)',
    '0px 1px 4px rgba(15, 23, 42, 0.1)',
    '0px 2px 4px -1px rgba(15, 23, 42, 0.1)',
    '0px 3px 6px -1px rgba(15, 23, 42, 0.1)',
    '0px 4px 8px -2px rgba(15, 23, 42, 0.1)',
    '0px 6px 12px -3px rgba(15, 23, 42, 0.1)',
    '0px 8px 16px -4px rgba(15, 23, 42, 0.1)',
    '0px 10px 20px -5px rgba(15, 23, 42, 0.1)',
    '0px 12px 24px -6px rgba(15, 23, 42, 0.1)',
    '0px 16px 32px -8px rgba(15, 23, 42, 0.1)',
    '0px 20px 40px -10px rgba(15, 23, 42, 0.1)',
    '0px 24px 48px -12px rgba(15, 23, 42, 0.1)',
    '0px 28px 56px -14px rgba(15, 23, 42, 0.1)',
    '0px 32px 64px -16px rgba(15, 23, 42, 0.1)',
    '0px 36px 72px -18px rgba(15, 23, 42, 0.1)',
    '0px 40px 80px -20px rgba(15, 23, 42, 0.1)',
    '0px 44px 88px -22px rgba(15, 23, 42, 0.1)',
    '0px 48px 96px -24px rgba(15, 23, 42, 0.1)',
    '0px 52px 104px -26px rgba(15, 23, 42, 0.1)',
    '0px 56px 112px -28px rgba(15, 23, 42, 0.1)',
    '0px 60px 120px -30px rgba(15, 23, 42, 0.1)',
    '0px 64px 128px -32px rgba(15, 23, 42, 0.1)',
  ],
  transitions: {
    duration: {
      shortest: 150,
      shorter: 200,
      short: 250,
      standard: 300,
      complex: 375,
      enteringScreen: 225,
      leavingScreen: 195,
    },
    easing: {
      easeInOut: 'cubic-bezier(0.4, 0, 0.2, 1)',
      easeOut: 'cubic-bezier(0.0, 0, 0.2, 1)',
      easeIn: 'cubic-bezier(0.4, 0, 1, 1)',
      sharp: 'cubic-bezier(0.4, 0, 0.6, 1)',
    },
  },
  palette: {
    primary: {
      main: '#4a6bff',
      light: '#7d95ff',
      dark: '#0045cc',
      contrastText: '#ffffff',
    },
    secondary: {
      main: '#6e3bde',
      light: '#9d6bff',
      dark: '#4d2a9a',
      contrastText: '#ffffff',
    },
    error: {
      main: '#ff3b5c',
    },
    success: {
      main: '#00c853',
    },
    warning: {
      main: '#ffab00',
    },
    info: {
      main: '#00b8d4',
    },
    background: {
      default: '#f8fafc',
      paper: '#ffffff',
    },
    text: {
      primary: '#1e293b',
      secondary: '#64748b',
      disabled: '#94a3b8',
    },
    divider: '#e2e8f0',
  },
  typography: {
    fontFamily: '"Inter", -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, sans-serif',
    htmlFontSize: 16,
    h1: {
      fontWeight: 700,
      fontSize: '2.5rem',
      lineHeight: 1.2,
      letterSpacing: '-0.02em',
      marginBottom: '1.5rem',
    },
    h2: {
      fontWeight: 700,
      fontSize: '2rem',
      lineHeight: 1.3,
      letterSpacing: '-0.015em',
      marginBottom: '1.25rem',
    },
    h3: {
      fontWeight: 600,
      fontSize: '1.5rem',
      lineHeight: 1.4,
      letterSpacing: '-0.01em',
      marginBottom: '1rem',
    },
    h4: {
      fontWeight: 600,
      fontSize: '1.25rem',
      lineHeight: 1.5,
      marginBottom: '0.75rem',
    },
    h5: {
      fontWeight: 600,
      fontSize: '1.125rem',
      lineHeight: 1.5,
      marginBottom: '0.5rem',
    },
    h6: {
      fontWeight: 600,
      fontSize: '1rem',
      lineHeight: 1.5,
      marginBottom: '0.5rem',
    },
    subtitle1: {
      fontSize: '1rem',
      lineHeight: 1.5,
      color: 'text.secondary',
    },
    subtitle2: {
      fontSize: '0.875rem',
      lineHeight: 1.5,
      color: 'text.secondary',
      fontWeight: 500,
    },
    body1: {
      fontSize: '1rem',
      lineHeight: 1.75,
    },
    body2: {
      fontSize: '0.875rem',
      lineHeight: 1.75,
      color: 'text.secondary',
    },
    button: {
      textTransform: 'none',
      fontWeight: 600,
      letterSpacing: '0.01em',
      fontSize: '0.9375rem',
    },
  },
});

const App: React.FC = () => {
  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <Router>
        <AuthProvider>
          <SocketProvider>
            <Routes>
              <Route path="/login" element={<LoginPage />} />
              <Route path="/register" element={<RegisterPage />} />
              <Route path="/" element={<Navigate to="/login" />} />
              <Route 
                path="/patient-dashboard" 
                element={
                  <PrivateRoute allowedRoles={['patient']}>
                    <PatientDashboard />
                  </PrivateRoute>
                } 
              />
              <Route 
                path="/doctor-dashboard" 
                element={
                  <PrivateRoute allowedRoles={['doctor']}>
                    <DoctorDashboard />
                  </PrivateRoute>
                } 
              />
              <Route 
                path="/chat/:userId" 
                element={
                  <PrivateRoute allowedRoles={['doctor', 'patient']}>
                    <ChatPage />
                  </PrivateRoute>
                } 
              />
            </Routes>
          </SocketProvider>
        </AuthProvider>
      </Router>
    </ThemeProvider>
  );
};

export default App;
